// src/components/common/MusicTile.tsx
import React from 'react';

interface MusicTileProps {
  title: string;
  artist: string;
}

const MusicTile: React.FC<MusicTileProps> = ({ title, artist }) => {
  const tileStyle: React.CSSProperties = {
    border: '1px solid #ccc',
    borderRadius: '8px',
    // padding: '16px',
    margin: '16px',
    textAlign: 'center',
    width: '200px',
  };

  const titleStyle: React.CSSProperties = {
    fontSize: '1.5em',
    color: '#333',
  };

  const artistStyle: React.CSSProperties = {
    fontSize: '1.2em',
    color: '#666',
  };
  const bottomText: React.CSSProperties = {
    display: 'flex',
    // justifyContent: 'center',
    // alignItems: 'center',
    // flexDirection: 'column',
  }

  return (
    <div style={tileStyle}>
      <img src="https://picsum.photos/200" alt={title} />
      <div style={bottomText}>
        <h3 style={titleStyle}>{title}</h3>
        <p style={artistStyle}>{artist}</p>
      </div>
    </div>
  );
};

export default MusicTile;
